import React from "react";
import Estilo from "../Hojas de Estilos/Encabezado.css";

import Menu from "./Menu";
import BotonMenu from "./BotonMenu";
function Encabezado(){
    return(
        <div className="cabecera">
            <Menu />
            <BotonMenu />
        </div>
    );
};
export default Encabezado;
